const express = require('express');
const http = require('http');
const WebSocket = require('ws');
const secrets = require('secrets.js-grempe');
const crypto = require('crypto');

const app = express();
const server = http.createServer(app);
const wss = new WebSocket.Server({ server });

const SECRET_KEY = crypto.randomBytes(32); // Symmetric key
const TOTAL_SHARES = 10;
const THRESHOLD = 5;
const shares = secrets.share(secrets.str2hex(SECRET_KEY.toString('hex')), TOTAL_SHARES, THRESHOLD);

let connectedClients = [];
let requestedShares = [];

// Encrypted image as base64
const iv = crypto.randomBytes(16);
const imageBase64 = '';
const imageBuffer = Buffer.from(imageBase64, 'base64');
const cipher = crypto.createCipheriv('aes-256-cbc', SECRET_KEY, iv);
let encryptedImage = cipher.update(imageBuffer);
encryptedImage = Buffer.concat([encryptedImage, cipher.final()]);
const encryptedImageBase64 = encryptedImage.toString('base64');


wss.on('connection', (ws) => {
  if (connectedClients.length < TOTAL_SHARES) {
    const clientShare = shares[connectedClients.length];
    connectedClients.push({ ws, share: clientShare });
    ws.send(JSON.stringify({ type: 'share', share: clientShare, encryptedImage: encryptedImageBase64, iv: iv.toString('base64') }));

    broadcast({ type: 'update', count: connectedClients.length });

    ws.on('message', (message) => {
      const data = JSON.parse(message);
      if (data.type === 'decrypt') {
        requestedShares.push(clientShare);

        broadcast({ type: 'decryptUpdate', count: requestedShares.length });

        if (requestedShares.length === THRESHOLD) {
          const combined = secrets.combine(requestedShares);
          const symmetricKey = Buffer.from(secrets.hex2str(combined), 'hex');
          broadcast({ type: 'reveal', secret: symmetricKey.toString('hex') });
        }
      }
    });

    ws.on('close', () => {
      connectedClients = connectedClients.filter(client => client.ws !== ws);
      requestedShares = requestedShares.filter(share => share !== clientShare);
      broadcast({ type: 'update', count: connectedClients.length });
    });
  } else {
    ws.send(JSON.stringify({ type: 'full', message: 'All slots filled!' }));
  }
});

function broadcast(data) {
  connectedClients.forEach(client => {
    if (client.ws.readyState === WebSocket.OPEN) {
      client.ws.send(JSON.stringify(data));
    }
  });
}


server.listen(process.env.PORT, () => console.log(`Server running on http://${process.env.PORT}`));
